Raiderette Softball

Great win in the regional semi-final for the Raiderettes by a score 5-1! Our defense was incredible tonight and our bats were great!
@samanthastew_and @lexx16322 with @addyreynolds2, Payten Lambert, and Zoey Larsen with great hits! Another regional final!!

